var tipuesearch = {"pages": [{'title': 'About', 'text': '使用cmsimde來建立網站 \n', 'tags': '', 'url': 'About.html'}, {'title': 'ROS', 'text': 'ROS  ( Robot Operating System )  專門為機器人軟體開發的一套電腦作業系統架構， \n 使用 P2P ( peer-to-peer ) 又稱為對等技術，是去中心化、依靠使用者群 (peers) 交換資 \n 訊的網際網路體系，可降低以往網路傳輸中的節點，降低資料遺失的風險。 \n \xa0 \n ROS 的主要設計目標在於機器人研發領域提高代碼復用率。 ROS 是一種分布是處理框 \n 架，又稱 Nodes 。 \n \xa0 \n SLAM 是Simultaneous localization and mapping的縮寫，意思為同步定位與建圖。 \n 主要用於解決機器人在未知環境運動時的定位與地圖構建問題。', 'tags': '', 'url': 'ROS.html'}]};